        <View style={styles.startFromContainer}>
          <Text style={styles.startFromText}>
            Starts from there where you end last time
          </Text>
          <MaterialIcons
            name="arrow-forward-ios"
            size={22}
            color="black"
            style={styles.startFromIcon}
